import React, { Component } from 'react';
imp

export default class Header extends Component {
  render() {
    return (
      <div>
          <div className='logo'>
            <h1>SnapLib</h1>
        </div>
        <div className='navb'>
            <Link to="">Home</Link>
            <Link to="">Photography</Link>
            <Link to="">Gallery</Link>
            <Link to="">About</Link>
            <Link to="">Contact</Link>
        </div>
      </div>
    )
  }
}
